# Secure Encryptor and Decryptor
# This script uses the cryptography.fernet module for secure symmetric encryption.
# Fernet is an implementation of symmetric authenticated encryption. It guarantees
# that a message encrypted using it cannot be manipulated or read without the key.
# For this to work, you must first install the library: pip install cryptography

from cryptography.fernet import Fernet
from cryptography.hazmat.primitives import hashes
from cryptography.hazmat.primitives.kdf.pbkdf2 import PBKDF2HMAC
import os
import base64

TEST_ENCRYPTED_MESSAGE_STR = ''

def derive_key(password, salt):
    """
    Derives a secure encryption key from a password and salt.

    Args:
        password (str): The human-readable password.
        salt (bytes): A unique random salt.

    Returns:
        bytes: A URL-safe base64-encoded key suitable for Fernet.
    """
    kdf = PBKDF2HMAC(
        algorithm=hashes.SHA256(),
        length=32,
        salt=salt,
        iterations=480000,
    )
    return base64.urlsafe_b64encode(kdf.derive(password.encode()))

def encrypt_message(message, password):
    """
    Encrypts a message using a password and a randomly generated salt.
    The salt is prepended to the encrypted message.

    Args:
        message (str): The plaintext message to encrypt.
        password (str): The human-readable password.

    Returns:
        bytes: The combined salt and encrypted ciphertext.
    """
    salt = os.urandom(16)
    key = derive_key(password, salt)
    f = Fernet(key)
    encrypted_message = f.encrypt(message.encode())
    return salt + encrypted_message

def decrypt_message(encrypted_data, password):
    """
    Decrypts an encrypted message by extracting the salt and using the password.

    Args:
        encrypted_data (bytes): The combined salt and encrypted ciphertext.
        password (str): The human-readable password.

    Returns:
        str: The decrypted plaintext message.
    """
    salt = encrypted_data[:16]
    encrypted_message = encrypted_data[16:]
    key = derive_key(password, salt)
    f = Fernet(key)
    return f.decrypt(encrypted_message).decode()

def encrypt_file(source_path, dest_path, password):
    """
    Reads a file's content, encrypts it, and writes the result to a new file.

    Args:
        source_path (str): The path to the file to encrypt.
        dest_path (str): The path where the encrypted file will be saved.
        password (str): The human-readable password.
    """
    try:
        with open(source_path, 'r', encoding='utf-8') as f:
            file_content = f.read()
        
        encrypted_content = encrypt_message(file_content, password)
        
        with open(dest_path, 'wb') as f:
            f.write(encrypted_content)
        
        print(f"File '{source_path}' successfully encrypted to '{dest_path}'.")
    except FileNotFoundError:
        print(f"Error: The file '{source_path}' was not found.")
    except Exception as e:
        print(f"An error occurred during encryption: {e}")

def decrypt_file(source_path, dest_path, password):
    """
    Reads an encrypted file, decrypts it, and writes the original content to a new file.

    Args:
        source_path (str): The path to the encrypted file.
        dest_path (str): The path where the decrypted file will be saved.
        password (str): The human-readable password.
    """
    try:
        with open(source_path, 'rb') as f:
            encrypted_content = f.read()
        
        decrypted_content = decrypt_message(encrypted_content, password)
        
        with open(dest_path, 'w', encoding='utf-8') as f:
            f.write(decrypted_content)
            
        print(f"File '{source_path}' successfully decrypted to '{dest_path}'.")
    except FileNotFoundError:
        print(f"Error: The file '{source_path}' was not found.")
    except Exception as e:
        print(f"An error occurred during decryption: {e}")



def decode_str_to_bytes(input_str):
    result_bytes = base64.urlsafe_b64decode(input_str)
    return result_bytes

def encode_bytes_to_str(input_bytes, encoding='utf-8'):    
    result_str = base64.urlsafe_b64encode(input_bytes).decode(encoding)
    return result_str


    
    
    

